import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './Home';  // Updated path
import CreateAccount from './CreateAccount';  // Updated path
import TransactionLogs from './TransactionLogs';  // Updated path
import LoginPage from './LoginPage';  // Updated path
import CreateUser from './CreateUser';  // Updated path

const App = () => {
    return (
        <AuthProvider>
            <Router>
                <div className="App">
                    <Routes>
                        <Route path="/" element={<Home />} />
                        <Route path="/create-account" element={<CreateAccount />} />
                        <Route path="/TransactionLogs" element={<TransactionLogs />} />
                        <Route path="/login-page" element={<LoginPage />} />
                        <Route path="/create-user" element={<CreateUser />} />
                        {/* Protect the dashboard route */}
                        <PrivateRoute path="/dashboard" element={<Dashboard />} />
                    </Routes>
                </div>
            </Router>
        </AuthProvider>
    );
};

export default App;
